import { Card } from 'antd';
import { useQuery } from '@apollo/client';

const getStyles = () => ({
  card: { width: '500px' },
});

export const ContactCard = () => {
  const styles = getStyles();

  const { loading, error, data } = useQuery();

  return <Card style={styles.card}>Elon Musk</Card>;
};
